CREATE TRIGGER `before_update_grades` BEFORE UPDATE ON `grades` FOR EACH ROW BEGIN
    DECLARE subject_formula ENUM('Core', 'Academic-Other', 'Academic-Special', 'TVL');
    DECLARE subject_semester ENUM('1', '2');

    -- Fetch the FormulaType and Semester from the subject table
    SELECT FormulaType, Semester INTO subject_formula, subject_semester
    FROM subject
    WHERE SubjectID = NEW.SubjectID;

    -- Validate semester and quarter relationship
    IF (subject_semester IS NOT NULL) AND 
       ((subject_semester = '1' AND NEW.quarter NOT IN ('Q1', 'Q2')) OR
        (subject_semester = '2' AND NEW.quarter NOT IN ('Q3', 'Q4'))) THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Invalid quarter for this subject semester';
    END IF;

    -- Ensure QA is calculated as a percentage (if provided)
    IF NEW.qa IS NOT NULL THEN
        SET NEW.qa = (NEW.qa / 50) * 100;
    END IF;

    -- Calculate Written Works & Quizzes Average
    SET NEW.ww_qz_average = (IFNULL(NEW.ww1, 0) + IFNULL(NEW.ww2, 0) + IFNULL(NEW.ww3, 0) + IFNULL(NEW.ww4, 0) +
                             IFNULL(NEW.qz1, 0) + IFNULL(NEW.qz2, 0) + IFNULL(NEW.qz3, 0) + IFNULL(NEW.qz4, 0)) / 8;

    -- Calculate Performance Task Average
    SET NEW.pt_average = (IFNULL(NEW.pt1, 0) + IFNULL(NEW.pt2, 0) + IFNULL(NEW.pt3, 0) + IFNULL(NEW.pt4, 0)) / 4;

    -- Calculate Quarter Grade Based on FormulaType
    CASE subject_formula
        WHEN 'Core' THEN
            SET NEW.quarter_grade = ROUND((NEW.ww_qz_average * 0.25) + (NEW.pt_average * 0.50) + (NEW.qa * 0.25), 0);
        WHEN 'Academic-Other' THEN
            SET NEW.quarter_grade = ROUND((NEW.ww_qz_average * 0.25) + (NEW.pt_average * 0.45) + (NEW.qa * 0.30), 0);
        WHEN 'Academic-Special' THEN
