CREATE TRIGGER `assign_strandname_before_insert` BEFORE INSERT ON `sections` FOR EACH ROW BEGIN
    -- Automatically assign StrandName based on SectionName patterns
    IF NEW.SectionName REGEXP '^HE-[A-E]$' THEN
        SET NEW.StrandName = 'HE-Combo 1';
    ELSEIF NEW.SectionName REGEXP '^HE-[F-J]$' THEN
        SET NEW.StrandName = 'HE-Combo 2';
    ELSEIF NEW.SectionName REGEXP '^ICT-[A-C]$' THEN
        SET NEW.StrandName = 'ICT-Programming';
    ELSEIF NEW.SectionName REGEXP '^ICT-[D-F]$' THEN
        SET NEW.StrandName = 'ICT-CSS';
    ELSEIF NEW.SectionName REGEXP '^HUMSS-[A-Z]$' THEN
        SET NEW.StrandName = 'HUMSS';
    ELSEIF NEW.SectionName REGEXP '^GAS-[A-Z]$' THEN
        SET NEW.StrandName = 'GAS';
    END IF;
END
$$
